webpackJsonp([32653175371190],{5192:function(e,a){e.exports={data:{post:{html:'<p>We just returned from Hannover, where Mama\'s company held a reception for their franchisees. The inauguration was on the hotel TV (4 different channels and languages) as we dressing, and at dinner I was asked about this strange and foreign ritual. One woman said that, watching without sound, the miitary parade, dark coats, somber faces and preacher looked more like a state funeral than anything else. I had no answer to that. </p>\n<p><a href="http://andrea.editthispage.com/2001/01/21">Andrea</a> asked about the movie "Fargo". Since we lived in Minnesota at the time the movie is set, I could <a href="http://andrea.editthispage.com/discuss/msgReader$1708?mode=day">answer her</a>.</p>',fields:{title:"Tiger of Magic",date:"21 Jan 2001",url:"https://papascott.de/2001-01-21-tiger-of-magic/"}}},pathContext:{slug:"/2001-01-21-tiger-of-magic/",prev:{fields:{title:"On Our Way Out the Door",date:"20 Jan 2001",slug:"/2001-01-20-on-our-way-out-the-door/"}},next:{fields:{title:"Only Time Will Tell",date:"27 Jan 2001",slug:"/2001-01-27-only-time-will-tell/"}}}}}});
